    does not. Any amount over the federal contribution limits has been refunded, reattributed
    within the 60 days, or re-designated to the Committee's Primary or General debt
    retirement accounts.  These refunds will be reflected in subsequent reports. For
    contributions with dates after November 6, 2012, 1) the contribution was postmarked
    prior to election day or 2) the donor has designated in writing that the contributions
    are for Primary or General debt retirement accounts, or 3) we are in the process
    of seeking authorization from the donor to designate the contributions to Primary
    or General debt retirement. If authorization is not obtained to designate to Primary
    or General debt within 60 days, these funds will be either refunded to the donor
    or disgorged to the United States Treasury. With respect to LLCs, our Committee
    has safeguards in place to ensure that all contributions are made by eligible
    donors only. Regarding donors who had mailing addresses outside the United States,
    our Committee has safeguards in place to ensure that all contributions are made
    by eligible donors only. With respect to the non-federal committees listed, our
    Committee has safeguards in place to ensure that these committees used permissible
    funds for the contributions. The Committee has reviewed all reimbursements to
    individuals for travel and subsistence and confirms that no further itemization
    is required under any Commission regulations for these expenditures.  No further
    itemization is required under FEC regulations. Checks were voided either because
    services were never rendered or they represent duplicate charges. Regarding disbursements
    on this report, the Committee continues to pay invoices received for pre-election
    expenses. Other disbursements include expenses necessary for the maintenance and
    wind-down of the Committee.\"\n"
